CREATE DEFINER=`nms`@`%` PROCEDURE `Add_System_Log_Cpu_Memory`(
	IN `serverip1` LONGTEXT
)
BEGIN

	set @cpu = (select SUM(cpu) from Temp_System_Log_Cpu_Memory where serverip = serverip1);
	set @memory := (select SUM(memory) from Temp_System_Log_Cpu_Memory where serverip = serverip1);
	set @hd := (select  hd from Temp_System_Log_Cpu_Memory where serverip = serverip1  order by time desc limit 1);
	set @count := (select count(cpu) from Temp_System_Log_Cpu_Memory where serverip = serverip1);
	set @cpuresult := @cpu / @count;
	set @memoryresult := @memory / @count;

	insert into System_Log_Cpu_Memory(cpu, memory, serverip, hd)
	values(@cpuresult, @memoryresult, serverip1, @hd);

	delete from Temp_System_Log_Cpu_Memory where serverip = serverip1;
	
		delete from Temp_System_Log_Cpu_Memory WHERE TIME < (NOW()- INTERVAL 2 day);
	
END ;;
