   SET @recCount = (select count(*) from secure_port_traffic where portname = portname1 and serverip = serverip1);
    If @recCount = 0 THEN
		insert into secure_port_traffic(serverip, portname , live , traffic)
		select serverip1, portname1, portlive1, sum1;
	end if;
	
   update secure_port_traffic set traffic = sum1, live = portlive1 where portname = portname1;
 
	


	insert into Secure_Log(serverip, traffic, time, cpu, memory, hd)
	select concat(serverip1,' ',portname1) , sum1 , now(), cpu1, memory1, hd1;


	delete from Temp_Secure_Port_Log_Traffic where serverip = concat(serverip1,' ',portname1);
	
	delete from Temp_Secure_Port_Log_Traffic WHERE TIME < (NOW()- INTERVAL 2 day);

END ;;
