CREATE DEFINER=`nms`@`%` PROCEDURE `Traffic_top`(
	IN `time1` LONGTEXT













)
BEGIN
DECLARE serverip1 varchar(50);
DECLARE traffic1 varchar(50);
DECLARE v_finished INTEGER DEFAULT 0;
DECLARE CUR CURSOR FOR SELECT serverip,traffic FROM temp_log1 order by traffic  desc;
DECLARE CUR1 CURSOR FOR select distinct  serverip, sum(traffic) AS traffic from Secure_Log where time >= DATE_SUB(NOW(), INTERVAL 10 MINUTE) GROUP BY serverip order by traffic desc LIMIT 10;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;





  DROP TEMPORARY TABLE IF EXISTS temp_log1;
	 CREATE TEMPORARY TABLE temp_log1
	(
		no int NOT NULL AUTO_INCREMENT,
		serverip varchar(50),
		traffic float,
		time datetime,
		UNIQUE KEY DA_AUTO_INCREMENT_TEST_IDX01(no)
	);


	set @SQL2 := CONCAT("insert into temp_log1(serverip,traffic)
	select distinct  serverip, sum(traffic) AS traffic from Secure_Log where time >= DATE_SUB(NOW(), INTERVAL 10 MINUTE) GROUP BY serverip order by traffic desc LIMIT 10");



	PREPARE stmt from @SQL2; 
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;


    DROP TEMPORARY TABLE IF EXISTS temp_log;
	 CREATE TEMPORARY TABLE temp_log
	(
		no int NOT NULL AUTO_INCREMENT,
		tempno int,
		serverip varchar(50),
		traffic float,
		time datetime,
		UNIQUE KEY DA_AUTO_INCREMENT_TEST_IDX01(no)
	);
	

OPEN CUR;
 read_loop: LOOP
FETCH CUR INTO serverip1,traffic1;
IF v_finished = 1 THEN 
 LEAVE read_loop;
 END IF;
 SET @recCount = (select count(*) from temp_log where serverip = serverip1);
       If @recCount = 0 THEN
	     INSERT temp_log (serverip, traffic) VALUES (serverip1,traffic1);
		end if;
end loop read_loop;
CLOSE CUR;

	SET @recCount = (select  count(*) from temp_log);
	If @recCount != 0 THEN
	select distinct  '1', serverip, traffic from temp_log order by no asc limit 3;
	end if;
	
	set v_finished = 0;
	SET @recCount = (select  count(*) from temp_log);
	If @recCount = 0 THEN
		OPEN CUR1;
	   read_loop: LOOP
		FETCH CUR1 INTO serverip1,traffic1;
